import React from 'react';
import './App.css';
import './bootstrap.min.css';

function App() {
  return (
    <div class="container_fluid">
		<nav class="navbar navbar-light bg-light header_bg">
		  <a class="navbar-brand" href="#">Navbar</a>
		</nav>
	</div>
  );
}

export default App;
